import React from "react";
import { Route,Routes } from "react-router-dom";
import Login from "./common/login";







const App =()=>{

    return(
        <>
        <div>
            <Routes>
           <Route exact path={'/login'} element={<Login/>}/>
            </Routes>    

            
            
           {/* <Fpage/> */}
         
            
    
            
        </div>
        </>
    )

}
export default App;
